  tabelaNoticias = [{"id":"643","data":"2014-12-16","titulo":"Hor\u00e1rios Final de  Ano SOUL","texto":"Prezado cliente,\r\n\r\nConfira a programa\u00e7\u00e3o de hor\u00e1rios da SOUL no final do ano:\r\n\r\nNatal:\r\n\r\n24\/12*: Tabela hor\u00e1ria de dias \u00fateis at\u00e9 \u00e0s 16h30. Ap\u00f3s \u00e0s 16h30, tabela hor\u00e1ria de s\u00e1bado.\r\n25\/12: Tabela hor\u00e1ria de domingo.\r\n26\/12: Tabela hor\u00e1ria de s\u00e1bado.\r\n\r\n\r\nAno Novo:\r\n\r\n31\/12*: Tabela hor\u00e1ria de dias \u00fateis at\u00e9 \u00e0s 16h30. Ap\u00f3s \u00e0s 16h30, tabela hor\u00e1ria de s\u00e1bado.\r\n01\/01: Tabela hor\u00e1ria de domingo.\r\n02\/01: Tabela hor\u00e1ria de s\u00e1bado.\r\n\r\n* Haver\u00e1 hor\u00e1rios de refor\u00e7o nos dias 24 e 31\/12, das 12h \u00e0s 14h.\r\n\r\nPara mais informa\u00e7\u00f5es, consulte o Servi\u00e7o de Atendimento ao Usu\u00e1rio pelo 800 510 2877 (De telefone fixo) ou 3442-8500 (De celular)"},{"id":"641","data":"2014-12-16","titulo":"Tabela Hor\u00e1ria de Ver\u00e3o","texto":"Prezados clientes,\r\n\r\nA partir de 26 de dezembro inicia a tabela hor\u00e1ria de ver\u00e3o, com t\u00e9rmino em 22 de fevereiro.\r\n\r\nConfira no link abaixo a tabela hor\u00e1ria completa em PDF."},{"id":"640","data":"2014-12-15","titulo":"Aprovados Projeto Pescar 2015","texto":"Os alunos selecionados devem entregar a CTPS (carteira de trabalho) e c\u00f3pia do RG E CPF dos respons\u00e1veis na sede da empresa entre os dias 22 e 23\/12\/2014. Entregar aos cuidados da Educadora Selma.\r\n\r\nSolicitamos a presen\u00e7as dos respons\u00e1veis no dia 24\/02\/2015, \u00e0s 13h30,  na sede da SOUL.\r\n\r\nIn\u00edcio das atividades: 02\/03\/2015 \u00e0s 8h\r\n\r\n\r\n\r\n\r\n\r\n\r\n*APROVADOS PROJETO PESCAR 2015\r\n\r\nALESSANDRA CORREA DE ARAUJO\r\nALEXSANDER MARTINS DE MOURA\r\nAMANDA PEREZ FERNANDES\r\nCAROLAINE RODRIGUES CARDOSO\r\nDANIELA DA SILVA FELIPE\r\nDEISE CAROLINE MELLO DE SOUZA\r\nDOUGLAS FERNANDO MULLER CORREA\r\nEMELI TAMIRES FURTADO DA SILVA\r\nESTER OLIVEIRA DA SILVA\r\nHUGNER CORREA DA SILVA\r\nIGOR DE SOUZA DA ROSA\r\nJACIARA DUBAL PILAR\r\nJULIANA LARISSA SILVEIRA PINHEIRO\r\nLIDIANE CORREA PACHECO\r\nLISIANE BORGES DE SOUZA\r\nLUCAS DAMI\u00c3O SILVA GARCIA\r\nMARCOS LUCAS GASS RAMOS\r\nMATEUS MONTAGNER DOS SANTOS\r\nMIGUEL ANGEL DE SOUZA PELERANO\r\nNICOLAS WEBER AMARAL\r\nPATRICK BRUNO DE LIMA QUINA\r\nPAULO LEONARDO MOTTA LIMA\r\nPETERSON DE LEMOS NUNES\r\nREINALD LEONARDO PIRES PINTO\r\nRENATA NUNES GOMES\r\nRITA DE CASSIA PEREIRA LEMOS\r\nTALES GABRIEL ZAWATSKI GON\u00c7ALVES\r\nTIAGO DA ROCHA XAVIER\r\nVAGNER LOPES DE CANTOS\r\nVITOR ANDR\u00c9 PADILHA SANTOS\r\n"},{"id":"642","data":"2014-12-12","titulo":"Unidade Projeto Pescar SOUL forma sua 14\u00aa turma","texto":"Na noite de 11 de dezembro foi realizada a cerim\u00f4nia de formatura da 14\u00aa turma da unidade Projeto Pescar SOUL.\r\n\r\nCercada de muita emo\u00e7\u00e3o, a cerim\u00f4nia de formatura contou com a presen\u00e7a de cerca de 400 pessoas entre elas, o Prefeito de Alvorada o Sr. S\u00e9rgio Maciel Bertold, Vereadores e Secret\u00e1rios Municipais, Lideran\u00e7as Comunit\u00e1rias e Religiosas, Conselho de Administra\u00e7\u00e3o e colaboradores da SOUL, o Presidente da ACIAL o Sr. Maur\u00edcio Cardoso que este ano foi o Paraninfo da turma, familiares dos formandos e demais convidados.\r\n\r\nDurante o evento uma mistura de sentimentos tomou conta dos formandos e de todos os presentes, era a alegria do dever cumprido com a emo\u00e7\u00e3o da despedida, que foi confortada pelos belos discursos da noite. \r\n\r\nEste ano o Projeto formou 29 alunos, entre meninos e meninas, no curso de Inicia\u00e7\u00e3o Profissional em Mec\u00e2nica B\u00e1sica, mas al\u00e9m do diploma, estes jovens tiveram a oportunidade de mudar o rumo de suas vidas, pois o Projeto os estimula a buscar com dignidade a realiza\u00e7\u00e3o de seus sonhos.\r\n\r\nO Projeto Pescar\r\n\r\nO Projeto Pescar atua desde 1976 com 142 unidades no Brasil e 29 no exterior e traz em sua miss\u00e3o o compromisso de desenvolver e acompanhar organiza\u00e7\u00f5es socialmente respons\u00e1veis, para oportunizar qualifica\u00e7\u00e3o profissional, desenvolvimento pessoal e cidadania a jovens em situa\u00e7\u00e3o de vulnerabilidade social. \r\n\r\nA SOUL \u00e9 parceira do projeto desde 2001 e j\u00e1 formou 342 jovens. Com carga hor\u00e1ria de aproximadamente mil horas, as aulas s\u00e3o ministradas por profissionais da SOUL e volunt\u00e1rios da comunidade. Al\u00e9m de Mec\u00e2nica, outras disciplinas fazem parte do curr\u00edculo, como Rela\u00e7\u00f5es Humanas, Seguran\u00e7a no Trabalho, Sa\u00fade, Meio Ambiente, Higiene Pessoal, Inform\u00e1tica, Motiva\u00e7\u00e3o, Comunica\u00e7\u00e3o, Trabalho em Equipe, Programa de Qualidade, Inser\u00e7\u00e3o no Mercado de Trabalho, entre outras.\r\n"},{"id":"639","data":"2014-11-27","titulo":"Venha fazer parte da equipe SOUL!","texto":"A empresa possui diversas oportunidades em seu quadro de colaboradores. Confira: \r\n\r\n- L\u00edder de Servi\u00e7os Gerais: Ensino m\u00e9dio completo. Turno: noite.\r\n\r\n- Motorista: CNH D ou E, acima de 23 anos, curso de transporte coletivo de passageiros e experi\u00eancia em caminh\u00e3o, \u00f4nibus ou lota\u00e7\u00e3o. Carga hor\u00e1ria: 7h20.\r\n\r\n- Cobrador: Ensino fundamental completo, acima de 21 anos. Carga Hor\u00e1ria: 7h20.\r\n\r\n- Manobrista: CNH D ou E, experi\u00eancia em ve\u00edculo de grande porte. Turno:  noite.  \r\n\r\n- Borracheiro: Montagem e desmontagem de pneus. Turno: noite.\r\n\r\n- Auxiliar de Opera\u00e7\u00f5es: Ensino m\u00e9dio em andamento. Hor\u00e1rio: disponibilidade integral.\r\n\r\n- Auxiliar de Mec\u00e2nico: Conhecimentos em mec\u00e2nica veicular.  Vagas para turno da noite e dia.\r\n\r\n- Est\u00e1gio em Seguran\u00e7a do Trabalho: Curso T\u00e9cnico em Seguran\u00e7a do Trabalho em andamento (a partir do segundo semestre). Carga Hor\u00e1ria: 4h \u0096 Est\u00e1gio n\u00e3o remunerado.\t\r\n\r\n- Moleiro: Com 2 anos de experi\u00eancia, conhecimento geral sobre suspens\u00e3o (molas, foles e amortecedores).\tHor\u00e1rio: das 8h30 \u00e0s 17h05.\t\r\n\r\n*** Benef\u00edcios oferecidos: Cart\u00e3o alimenta\u00e7\u00e3o, cesta b\u00e1sica, assist\u00eancia m\u00e9dica e odontol\u00f3gica extensiva aos dependentes, transporte gratuito, uniforme completo, programas de valoriza\u00e7\u00e3o e reconhecimento dos colaboradores.  \r\n\r\nPessoas com Defici\u00eancia e Reabilitados do INSS s\u00e3o bem-vindos.\r\n\r\nInteressados enviar curr\u00edculo para o e-mail  drh@soul.com.br \r\n\r\nMais informa\u00e7\u00f5es pelo telefone 3442-8510.\r\n"},{"id":"638","data":"2014-10-31","titulo":"Pr\u00e9-selecionados para o Projeto Pescar SOUL 2015","texto":"Fique atento! Os pr\u00e9-selecionados devem entrar em contato telef\u00f4nico com a SOUL pelo 3442-8572 para agendar a pr\u00f3xima etapa da sele\u00e7\u00e3o.\r\n\r\nLista dos Pr\u00e9-selecionados:\r\n\r\nADONIAS PADILHA DE AZEVEDO\r\nALANA BARBOSA FERREIRA\r\nALESSANDRA CORREIA DE ARA\u00daJO\r\nALEXSANDER MARTINS DE MOURA\r\nAMANDA PERES FERNANDES\r\nANDRESSA CARDOSO RIBEIRO\r\nCARLOS EDUARDO FELIPE DA SILVA\r\nCAROLAINE ROBRIGUES CARDOSO\r\nCAROLINA POOCH GON\u00c7ALVES\r\nCASSIA ASSIS DE OLIVEIRA\r\nCRISLENE ANTUNES\r\nDANIELA DA SILVA FELIPE \r\nDEISE CAROLINE MELLO DE SOUZA\r\nDIEGO GABRIEL SANTOS DA SILVA\r\nDOUGLAS FERNANDO MULLER CORREA\r\nEMELI TAMIRES FURTADO DA SILVA\r\nERICSON MIRANDA MOR \r\nESTER DA SILVA ALVARES\r\nESTER OLIVEIRA DA SILVA\r\nFRANCIELE CASTRO DE SOUZA\r\nGABRIELLE SPENCER DOS SANTOS CARVALHO\r\nHUGNER CORREA DA SILVA\r\nIGOR DE SOUZA DA ROSA\r\nJACIARA DUBAL PILAR \r\nJ\u00c9SSICA PEREIRA GOMES\r\nJO\u00c3O GABRIEL NASCIMENTO MACIEL\r\nJULIANA CONCEI\u00c7\u00c3O MANTINHO\r\nJULIANA LARISSA SILVEIRA PINHEIRO\r\nLARISSA AGUIAR DE AZEVEDO\r\nLIDIANE CORREA PACHECO\r\nLISIANE BORGES DE SOUZA\r\nLUCAS DAMI\u00c3O SILVA GARCIA\r\nLUCAS DE MIRANDA ASSENHEIMER\r\nLUCAS KNACK DA SILVA\r\nLUCAS MACHADO GON\u00c7ALVES\r\nLUNA DESIRR\u00c9 TRINDADE CORREA DA SILVA\r\nMARCELO BOAVENTURA CONCEI\u00c7\u00c3O DA SILVA JUNIOR\r\nMARCOS EDUARDO DOS SANTOS DE ARAUJO\r\nMARCOS LUCAS GASS RAMOS\r\nMARJANA FERREIRA\r\nMATEUS MONTAGNER DOS SANTOS\r\nMICHEL LENON DA SILVA VERDUM\r\nMIGUEL ANGEL DE SOUZA PELLERANO\r\nNICOLAS ANDRADE FRANCO\r\nN\u00cdCOLAS WEBER AMARAL\r\nPATRICK BRUNO DE LIMA QUINA\r\nPAULO LEONARDO MOTTA LIMA\r\nPETERSON DE LEMOS NUNES\r\nRAFAELA ROSELI DE MATOS DA SILVA\r\nRAPHAEL MACHADO DA SILVA\r\nRAPHAELA SAMUEL BARRETO\r\nRAUL TEIXEIRA DE AZEVEDO\r\nREINALDO LEONARDO PIRES PINTO\r\nRENATA CASTRO DUARTE\r\nRENATA NUNES GOMES\r\nRITA DE C\u00c1SSIA PEREIRA LEMOS\r\nRITIELE REIS DA CONCEI\u00c7\u00c3O\r\nROBERTA GRAZIELA GON\u00c7ALVES E SILVA\r\nSAMANTA SITO RODRIGUES\r\nTALES GABRIEL ZAWATSKI GON\u00c7ALVES\r\nTAYLOR ALMEIDA DE GOES\r\nTHAIS GERHARDT DE SOUZA\r\nTIAGO DA ROCHA XAVIER\r\nVAGNER LOPES DE CANTO\r\nVINICIUS BUENO AIEDO\r\nVITOR ANDRE PADILHA SANTOS\r\nWESLEY DIAS COSTA \r\nWILLIAM C\u00c9SAR NUNES DA SILVA\r\nWILLIAN LOPES PINHEIRO\r\n"},{"id":"637","data":"2014-10-24","titulo":"Confira as mudan\u00e7as de hor\u00e1rios a partir de 29 de outubro","texto":"Confira as mudan\u00e7as de hor\u00e1rios a partir de 29 de outubro\r\n\r\nPrezados(a) usu\u00e1rios(a),\r\n\r\nPara melhor atender os clientes, a Metroplam autorizou o seguinte ajuste de hor\u00e1rio, a partir \r\nde 29 de outubro de 2014:\r\n\r\nLinha 11 de Abril - sentido de Alvorada para Porto Alegre em dias \u00fateis\r\nDe 6h20\r\nPara 6h15\r\n\r\nLinha Alvorada Prot\u00e1sio Alves - sentido de Porto Alegre para Alvorada em dias \u00fateis\r\nDe 7h30\r\nPara 7h35\r\n\r\nLinha Americana - sentido de Porto Alegre para Alvorada em dias \u00fateis\r\nDe 20h35\r\nPara 20h25\r\n\r\nLinha Portoverde Sert\u00f3rio - sentido de Alvorada para Porto Alegre em dias \u00fateis\r\nDe 7h03\r\nPara 7h05\r\n\r\nLinha Portoverde - sentido de Alvorada para Porto Alegre em dias \u00fateis\r\nDe 7h05\r\nPara 7h03\r\n\r\nLinha Salom\u00e9 Sert\u00f3rio - sentido de Alvorada para Porto Alegre em dias \u00fateis\r\nDe 6h03\r\nPara 6h\r\n\r\nLinha Umbu Anchieta - sentido de Alvorada para Porto Alegre em dias \u00fateis\r\nDe 7h35\r\nPara 7h40\r\n\r\nLinha Umbu Sert\u00f3rio Cairu - sentido de Alvorada para Porto Alegre em dias \u00fateis\r\nDe 7h30\r\nPara 7h35\r\n\r\nLinha Vila Elza Prot\u00e1sio Alves - sentido de Alvorada para Porto Alegre em dias \u00fateis\r\nDe 6h10\r\nPara 6h05"},{"id":"636","data":"2014-10-22","titulo":"Queda de ponte no bairro Intersul ","texto":"Em raz\u00e3o da queda da ponte localizada na rua Ot\u00e1vio Rocha no bairro Intersul.\r\n\r\nAs ruas Padre N\u00f3brega, Ot\u00e1vio Rocha e Bar\u00e3o do Cerro Largo, n\u00e3o est\u00e3o sendo atendidas.\r\n\r\nOs usu\u00e1rios que embarcam nestas ruas devem se deslocar para a Av. Frederico Dihl ou Rua \r\nAndrade Neves.  \r\n\r\n O itiner\u00e1rio voltar\u00e1 ao normal assim que a ponte estiver liberada."},{"id":"635","data":"2014-10-16","titulo":"Mudan\u00e7a no envio de curr\u00edculos ","texto":"A partir de 20 de outubro, a Empresa receber\u00e1 curr\u00edculos somente por e-mail.\r\n \r\nN\u00e3o ser\u00e3o aceitos curr\u00edculos em papel. \r\n\r\nOs candidatos devem enviar o curr\u00edculo com o n\u00famero do RG e do CPF para o \r\ne-mail  drh@soul.com.br, informando no campo \"assunto\" o cargo pretendido.\r\n \r\nO curr\u00edculo ficar\u00e1 v\u00e1lido no banco de dados da Empresa por um per\u00edodo de \r\nseis meses.\r\n\r\nPara mais informa\u00e7\u00f5es ligue 3442-8510 ou 34428511."},{"id":"634","data":"2014-10-01","titulo":"Unidade Projeto Pescar SOUL abre inscri\u00e7\u00f5es de 6 a 10 de outubro","texto":"Entre os dias 6 e 10 de outubro, a Unidade Projeto Pescar SOUL abre inscri\u00e7\u00f5es para sua 15\u00aa turma. \r\n\r\nPodem se inscrever: meninos e meninas entre 14 e 24 anos que estejam cursando a partir da 7\u00aa s\u00e9rie do ensino fundamental ou que j\u00e1 tenham conclu\u00eddo o ensino m\u00e9dio em escola p\u00fablica, com renda de at\u00e9 meio sal\u00e1rio-m\u00ednimo por morador na resid\u00eancia e residir no Munic\u00edpio de Alvorada. Para pessoas com defici\u00eancia n\u00e3o h\u00e1 limite m\u00e1ximo de idade ou exig\u00eancia de escolaridade.\r\n\r\nAl\u00e9m da forma\u00e7\u00e3o em mec\u00e2nica b\u00e1sica, os selecionados para a Unidade Projeto Pescar SOUL participam de diversas atividades para o desenvolvimento de no\u00e7\u00f5es como: rela\u00e7\u00f5es humanas, cidadania, seguran\u00e7a no trabalho, sa\u00fade, higiene pessoal, motiva\u00e7\u00e3o, comunica\u00e7\u00e3o, m\u00fasica, inform\u00e1tica, trabalho em equipe, programa de qualidade e inser\u00e7\u00e3o ao mercado de trabalho. As aulas s\u00e3o ministradas por profissionais da SOUL e volunt\u00e1rios da comunidade e a carga hor\u00e1ria \u00e9 de 800 horas. \r\n\r\nOs alunos da Unidade recebem, transporte, material did\u00e1tico, cestas b\u00e1sicas, uniforme e bolsa aux\u00edlio. A parceria entre a Funda\u00e7\u00e3o Projeto Pescar e SOUL existe h\u00e1 quatorze anos e \u00e9 destinada a jovens em situa\u00e7\u00e3o de risco social que residam em Alvorada. Ao final do curso os jovens s\u00e3o encaminhados ao mercado de trabalho em busca da primeira oportunidade de emprego. \r\n\r\n\r\nQuando: de 6 a 10 de outubro\r\nHor\u00e1rio - Manh\u00e3: das 8h15 \u00e0s 10h30\r\nHor\u00e1rio - Tarde: das 13h15 \u00e0s 15h30\r\n\r\nLocal: Sede da SOUL- Av. Pres. Get\u00falio Vargas, 3116 - Alvorada - RS\r\n\r\nDocumentos Necess\u00e1rios:\r\nFoto 3X4 no ato da inscri\u00e7\u00e3o;\r\nCarteira de Identidade, CPF ou certid\u00e3o de nascimento (c\u00f3pia);\r\nComprovante de resid\u00eancia: \u00faltima conta de \u00e1gua ou luz (c\u00f3pia);\r\nComprovante de escolaridade.\r\n\r\nMais Informa\u00e7\u00f5es: 3442-8500 \/ 3442-8572"}];
